import React from "react";
import ReactDom from "react-dom";
import Heading from "./Heading";

ReactDom.render(
  <>
    <Heading></Heading>
    <p>This is my world</p>
    <ol>
      <li>Vishal</li>
      <li>Lohemor</li>
      <li>dob</li>
      <li>faridabad</li>
    </ol>
  </>,
  document.getElementById("root")
);
